import { Component } from "react";

export default class Banner extends Component {
  componentDidMount() {}

  render() {
    return (
      <div>
        <div class="swiper-container">
          <div class="swiper-wrapper">
            <div class="swiper-slide">
              <img src="/static/banner/banner1.png" />
              <img src="/static/banner/banner2.png" />
              <img src="/static/banner/banner3.png" />
              <img src="/static/banner/banner4.png" />
            </div>
          </div>
        </div>
      </div>
    );
  }
}
